DROP TABLE "Store" CASCADE;
DROP TABLE "Product" CASCADE;
DROP TABLE "Inventory" CASCADE;

commit;

CREATE TABLE "Store" (
	"id" integer NOT NULL,
	"phone" varchar(50) NOT NULL,
	"addressLine1" varchar(50) NOT NULL,
	"addressLine2" varchar(50) DEFAULT NULL,
	"city" varchar(50) NOT NULL,
	"state" varchar(50) NOT NULL,
	"postalCode" varchar(50) NOT NULL,
	"country" varchar(50) DEFAULT 'USA',
	PRIMARY KEY ( "id" )
 );
 
 CREATE TABLE "Product" (
	"id" integer NOT NULL,
	"productName" varchar(50) NOT NULL,
	"productSize" varchar(50) NOT NULL,
	"productVendor" varchar(50) NOT NULL,
	"productDescription" varchar(50) NOT NULL,
	"buyPrice" numeric(6,2) NOT NULL,
	"msrp" numeric(6,2) NOT NULL,
	"departmentCode" integer NOT NULL,
	PRIMARY KEY ( "id" )
);
 

CREATE TABLE "Inventory" (
	"storeId" integer NOT NULL,
	"productId" integer NOT NULL,
	"quantity" integer NOT NULL,
	PRIMARY KEY ( "storeId", "productId" ),
	CONSTRAINT inventory_store_fk FOREIGN KEY ( "storeId" ) REFERENCES "Store" ( "id" ),
	CONSTRAINT inventory_product_fk FOREIGN KEY ( "productId" ) REFERENCES "Product" ( "id" )
);

commit;

